B.H5=new A.bn(B.aR,5,1,B.Z3,2,"This weapon does not cause direct damage. The first uncanceled hit represents the harpoon catching the target and the chain going taut. The target spins to either face directly away from or towards the attacker, whichever requires the smallest rotation. This triggers a Collision Window.\n\nEach subsequent uncanceled hit represents the target being reeled in, manifesting as a forced Short Straight move toward the attacker.\n\nIf the target is heavier than the attacker, the attacker is spun and moved toward the target instead.",15,"harpoon")
